import { Component } from "react";
import NavOuter from "./NavOuter";
export default class NavInner extends Component{
    constructor(props){
        super(props);
        this.state = {
            light : false
        };
        this.style = {
            display : this.updateDsiplay()
        }
    }
    updateDsiplay(){
        let D = (this.state.light) ? "block" : "none";
        return(D);
    }
    render(){
        return(
        <div>
            <NavOuter style = { "display :" + this.state.display}></NavOuter>
            <div>
                <nav>
                    <img src="/assets/logo.png" alt="this is a logo"/>
                    
                        <button onClick = {
                            () => {this.setState({light : !this.state.light});
                            this.updateDsiplay();
                            console.log(this.style.display,this.state.light);
                            }}>
                        <img src="/assets/navIcon.png" alt="this is the nav icon" />
                        </button>
                        
                </nav>
            </div>
            <div>
                <p>Ridley Community Church</p>
                <p>An Evangelical Church in Forest Gate</p>
            </div>
        </div>
        )
    }

};
